create table users (
  id SERIAL PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	ip_address VARCHAR(20)
);

create table orders (
	order_id INT,
	product_name VARCHAR(50),
	quantity INT,
	unit_price DECIMAL(6,2),
	total_price DECIMAL(10,2),
  user_id int,
  FOREIGN KEY (user_id) REFERENCES users(id)
);





